import React from 'react';
import { Row, Col } from 'antd';

const AppLayout = ({ children }) => {
    return (
        <>
            <Row gutter={[16, 16]}>
                <Col>

                </Col>
                
                <Col>
                {children}
                </Col>
                
                <Col>

                </Col>
            </Row>
        </>
    )
}

export default AppLayout;
